import style from './HeaderButton.module.css'
import CartIcon from '../Cart/CartIcon'

const HeaderButton = () => {
  return (
    <button className={style.button}>
      <CartIcon/>
      <span>logo</span>
      <span className={style.icon}>Cart</span>
      <span className={style.badge}>2</span>

    </button>
  )
}

export default HeaderButton
